import axios from 'axios';

const API_URL = process.env.REACT_APP_API_URL || 'http://localhost:3001/api';

const login = (email, password) => {
  return axios.post(`${API_URL}/usuarios/login`, {
    email,
    password
  });
};

const authService = {
  login
};

export default authService;
